package map;

import java.util.Hashtable;

public class HashTableDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Hashtable<Integer, String> ht = new Hashtable<Integer, String>();
		ht.put(56, "ram");
		ht.put(67, "naren");
		ht.put(34, "ramya");
		ht.put(15, "arun");
		ht.put(78, "meghaana");
		ht.put(87, "john");
		
		
		
		
		System.out.println(ht);

	}

}
